	reversed.reserve(str.length());
	std::reverse_copy(str.begin(), str.end(), std::back_inserter(reversed));
	return reversed;
}

void ReverseLines(std::istream& input, std::ostream& output)
{
	std::string line;
	while (std::getline(input, line))
	{
		output << Reverse(line);
		if (input.good())
		{
			output << "\n";
		}
	}
}

